@targon・4 New update announcement! Planning a Thursday mid-day release. An exact date will be announced once we have everything finished up.
This is semi-short notice; but this is a much needed stability fix that i would like to get out asap; im sure your all aware of the valis dropping out all the time. From what i can tell, this is due to the newer BT versions. This update is primarily for valis, however the base miner code will also be updating to the new bittensor version aswell.

Because this is a large bittensor upgrade, few things valis need to note and be ready for;
- Your .venv will need to be completely deleted and re-created. Bittensor package doesnt seem to do well upgrading in place w/ the other deps.
- MAKE SURE you are on at least python 3.10.12. py. If you need multiple python versions on your machine, pyenv has been pretty easy / nice to use.
